        private void AddNote(string assetType, string sapEquipmentId, string note)
        {
            Execute.Sql($@"DECLARE @dataTypeId int, @assetId int;
SELECT @dataTypeId = DataTypeId FROM DataType WHERE Table_Name = '{assetType}s';
SELECT @assetId = Id FROM {assetType}s WHERE SAPEquipmentID = {sapEquipmentId};
IF @assetId IS NOT NULL
BEGIN
INSERT INTO Note (Note, DataLinkID, DataTypeID, CreatedBy) VALUES ('{note}', @assetId, @dataTypeId, 'import');
END");
        }

